(1, 1, '2015-06-28 16:32:12', '2015-06-28 16:32:12', 'Year-round Discount: Enjoy a 15% Discount upon purchase on the 2<sup>nd</sup> pair of eyewear and 20% Discount on the 3<sup>rd</sup> pair or after', 'Year-round Discount: Enjoy a 15% Discount upon purchase on the 2nd pair of eyewear and 20% Discount on the 3rd pair or after', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2015-07-01 18:17:06', '2015-07-01 18:17:06', '', 0, 'http://local.egg.com/?p=1', 0, 'post', '', 1),
(2, 1, '2015-06-28 16:32:12', '2015-06-28 16:32:12', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://local.egg.com/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'trash', 'open', 'open', '', 'sample-page', '', '', '2015-06-28 16:57:47', '2015-06-28 16:57:47', '', 0, 'http://local.egg.com/?page_id=2', 0, 'page', '', 0),
(4, 1, '2015-06-28 16:45:08', '2015-06-28 16:45:08', '<h3>Meaning of the brand</h3>\r\nThe egg is the start of a new life. The eGG eyewear brand seeks to break away from the boring convention of an optical shop. eGG glasses go far beyond functionality, they are indispensable fashion accessories for any outfit. To enable customers to keep up with the fashion trends and purchase spectacles of different styles to match their wardrobe, eGG makes its eyewear products affordable for all and inspires shoppers to purchase several items in one go for mix and match.', 'Home', '', 'publish', 'open', 'open', '', 'home', '', '', '2015-07-06 17:04:42', '2015-07-06 17:04:42', '', 0, 'http://local.egg.com/home/', -1, 'page', '', 0),
