(105, 1, '2015-07-06 14:21:51', '2015-07-06 14:21:51', '<h3>Meaning of the brand</h3>\r\nThe egg is the start of a new life. The eGG eyewear brand seeks to break away from the boring convention of an optical shop. eGG glasses go far beyond functionality, they are indispensable fashion accessories for any outfit. To enable customers to keep up with the fashion trends and purchase spectacles of different styles to match their wardrobe, eGG makes its eyewear products affordable for all and inspires shoppers to purchase several items in one go for mix and match.', 'Home', '', 'inherit', 'open', 'open', '', '4-revision-v1', '', '', '2015-07-06 14:21:51', '2015-07-06 14:21:51', '', 4, 'http://local.egg.com/4-revision-v1/', 0, 'revision', '', 0),
