(115, 1, '2015-07-06 16:42:59', '2015-07-06 16:42:59', '<h3><strong>品牌及營運理念</strong></h3>\r\n蛋，是新生命誕生的開始。 eGG眼鏡品牌致力打破眼鏡店守舊和嚴肅的框框。 eGG提供的眼鏡不僅能調節視力，它更是配襯衣飾不可或缺的元素。 因為eGG希望顧客能應潮流需要配備不同眼鏡，所以價錢方面較大眾化，務求增快顧客的回購頻率，並鼓勵顧客一次購買多副眼鏡。', '主頁', '', 'inherit', 'open', 'open', '', '33-revision-v1', '', '', '2015-07-06 16:42:59', '2015-07-06 16:42:59', '', 33, 'http://local.egg.com/33-revision-v1/', 0, 'revision', '', 0),
